import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Search from './components/Search';
import AppDetails from './components/AppDetail';
import gplayLogo from './components/logo.png'
import {useNavigate} from "react-router-dom";
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import { render } from '@testing-library/react';

function App() {

  function Rescrape(){
    const navigate = useNavigate();
      navigate.push("/scrape");
  }

  return (
  <>
    <div className="container d-flex justify-content-between align-items-center">
      <img src={gplayLogo} style={{ width: "20rem", position: "relative", left: "38%", cursor: "pointer" }} alt="" onClick={Rescrape}/>
    </div>
    <Router>
      <Switch>
        <Route path = '/' component={Search}/>
        <Route path = '/app' component={AppDetails}/>
      </Switch>
    {/* <Search /> */}
    </Router>
  </>
  );
}

export default App;
